#include <iostream>
#include <unordered_map>

#include "Tree.h"

using namespace std;

/**
 * Definition for a binary tree node.
 * struct TreeNode {
 *     int val;
 *     TreeNode *left;
 *     TreeNode *right;
 *     TreeNode(int x) : val(x), left(NULL), right(NULL) {}
 * };
 */
class Solution {
public:
    int rob(TreeNode* root) {
        return dfs(root).first;
    }

    pair<int, int> dfs(TreeNode *root)
    {
        pair<int, int> dp = make_pair(0, 0);

        if (root)
        {
            pair<int, int> dp_L = dfs(root->left);
            pair<int, int> dp_R = dfs(root->right);
            dp.second = dp_L.first + dp_R.first;
            dp.first = max(dp.second, dp_L.second + dp_R.second + root->val);
        }

        return dp;
    }

    int rob2(TreeNode* root) {
        if (root == nullptr)
        {
            return 0;
        }
        
        if (m.find(root) != m.end())
        {
            return m[root];
        }

        int a = root->val;

        if (root->left != nullptr)
        {
            a += rob2(root->left->left);
            a += rob2(root->left->right);
        }

        if (root->right != nullptr)
        {
            a += rob2(root->right->left);
            a += rob2(root->right->right);
        }

        int b = rob2(root->left) + rob2(root->right);
        int maxV = max(a, b);
        m[root] = maxV;
        return maxV;
    }

    int rob1(TreeNode* root) {
        return max(rob1(root, true), rob1(root, false));
    }
    
    int rob1(TreeNode *root, bool canRob)
    {
        if (root == nullptr)
        {
            return 0;
        }

        int maxV = 0;

        if (canRob)
        {
            // get the sum of these, NOT max(left, right);
            maxV = root->val + rob1(root->left, !canRob) + rob1(root->right, !canRob);
        }
        else
        {
            maxV = max(rob1(root->left, canRob), rob1(root->left, !canRob)) + 
                   max(rob1(root->right, canRob), rob1(root->right, !canRob)); 
        }

        return maxV;
    }

private:
    unordered_map<TreeNode *, int> m;
};

